import { Paper } from '@mui/material'
import React from 'react'

function PlaceOrder() {
    return (
        <Paper sx={{
            position: 'relative',
            display: 'flex',
            gap: 3,
            m: '1rem'
        }}>
            <Button variant="contained" sx={{ bgcolor: '#ff3d00', "&:hover": { backgroundColor: "#ff3d00", } }} startIcon={<LocalMallIcon />}>BUY NOW</Button>
        </Paper>
    )
}

export default PlaceOrder
